function toTitleCase(n){return n===undefined||n===null?"":n.replace(/\w\S*/g,function(n){return n.charAt(0).toUpperCase()+n.substr(1).toLowerCase()})}function toCamelCase(n){return n===undefined||n===null?"":n.replace(/\w\S*/g,function(n){return n.charAt(0).toLowerCase()+n.substr(1)})}function getDates(n,t){const r=[];for(var i=n;i<=t;)r.push(new Date(i)),i=window.moment(i).add(1,"days");return r}var contDisp=function(){return window.$("html").height()};